import React from "react";
import {
  NoStyleDiv,
  Span,
  OrderButton,
  Bold,
  OrderText,
} from "../../styles/cart";
class Order extends React.Component {
  constructor(props: any) {
    super(props.currency);
  }
  render() {
    return (
      <div>
        <Span>
          Tax 21%: <Bold>{currency}15.00</Bold>
        </Span>
        <Span>
          Qauntity: <Bold>{totalQuantity}</Bold>
        </Span>
        <NoStyleDiv>
          <Span>
            Total:{" "}
            <Bold>
              {currency}
              {totalAmount}
            </Bold>
          </Span>
        </NoStyleDiv>
        <OrderButton>
          <OrderText>ORDER</OrderText>
        </OrderButton>
      </div>
    );
  }
}

export default Order;
